import Navigation from "../components/Navigation";

const ErreurPage = () => {
  return (
    <>
      <Navigation />
      <main>
        <h1>Page d'erreur </h1>
        <p>La page que vous cherchez n'existe pas , SORRY</p>
      </main>
    </>
  );
};

export default ErreurPage;
